\section{Basis Invariants for Higher-Order Corrections}

The building block of the prescription described in (\ref{L0L1L2_emptyset}) is $\left(\Delta_1G_\emptyset(p)\right)^{\mathrm{red}}_\ell$. In this section, we expand it\footnote{There are 2,974 terms.} and choose to collect\footnote{We used MS Excel spreadsheet software to sort the generated invariants according to increasing string length.}
the terms of similar mass-dimensions\footnote{In the 2,974-term collection, mass-dimensions range from 3 up to 26.}, ranging from [3] up to [12]. With the notation
\begin{eqnarray}
  [\ell]\equiv(\Delta_1G_{\emptyset_{\mathrm{t}}}(p))^{\mathrm{red}}_{\ell}
\label{ellll}
\end{eqnarray}
denoting the common mass-dimension of the collected terms.

A replacement $G_{\emptyset}\to G_{\emptyset_{\mathrm{t}}}$ (with $G_{\emptyset}$ given in (\ref{Gxrewritten})) will be implemented:
\begin{eqnarray}
  G_{\emptyset}(p)\to G_{\emptyset_{\mathrm{t}}}(p) \equiv \int^\infty_0 ds_0\,\,\, e^{\Theta_{\mathrm{TSE}_\mathrm{t}}}= \int^\infty_0 ds_0\,\,\, e^{({\cal X}-m^2-p^2)s_0}.
\end{eqnarray}
with $\Theta_{\mathrm{TSE}}$ now truncated\footnote{This is upon considering only the first term of Taylor expanded $R(s)$ given in (\ref{taylRs}) with $P(s)$ and $Q(s)$ completely disregarded.} $\Theta_{\mathrm{TSE}_\mathrm{t}}$ and $X$ redefined as $X \to {\cal X} -m^2$. Note that a subscript $0$ is instituted on the proper-time parameter $s$. This is to distinguish higher-fold proper-time integrations with respect to $s_1,s_2,\ldots$ that may become relevant in higher-order calculations.

We will group terms coming from different order of corrections that will give a total mass-dimension of twelve or less. Note that the collection includes odd mass-dimensions. We know that such odd mass-dimensions vanish owing to their odd powers in $p$-integration. We consider them here as they do not vanish in the higher order expansion for example, when they are multiplied to any odd mass-dimension collection of invariants.

With the knowledge on the mass-dimensions discussed in the earlier part of this chapter, we enumerate below the result of collecting invariants containing similar total mass-dimensions and then contracting kronecker delta indices:\footnote{Refer to Appendix B for mass-dimensional basis with uncontracted kronecker delta indices}

