\begin{small}
\begin{eqnarray}
[3]_\ell=+\int^\infty_0 d_{s_\ell}
    \frac{2i}{3}
      \left[ {\cal D}_{\mu_\ell}\!Y_{{\lambda_\ell}{\mu_\ell}}\,p\,{s_\ell}
            +4 {\cal D}_{\kappa_\ell}\!Y_{{\lambda_\ell}{\tau_\ell}}\,p^3\,{s_\ell}^2\right]
      e^{({\cal X}-m^2-p^2)s_\ell}
\label{thr}
\end{eqnarray}
\end{small}
The first term in (\ref{thr}) agrees with Eqn. 2.94 of \cite{Rodf-Diss}.  Ref. \cite{Rodf-Diss} disregarded the last term which we choose to display instead. Here, $p^n$ means $p_{\lambda_\ell}p_{\tau_\ell}\ldots$ whose subscripts are identified from the unpaired tensorial indices. %The unsimplified version of (\ref{thr}) can be seen in Appendix B Eqn. (\ref{unthr}).

