    + \frac{3}{2}\left({\cal D}_{{\mu_\ell}{\tau_\ell}}\!Y_{{\mu_\ell}{\lambda_\ell}}
                  - {\cal D}_{{\tau_\ell}{\mu_\ell}}\!Y_{{\lambda_\ell}{\mu_\ell}}\right)
   \right]
- 2 {p}^4 {s_\ell}^3 {\cal D}_{{\eta_\ell}{\kappa_\ell}}\!Y_{{\lambda_\ell}{\tau_\ell}}
\right\}
      e^{({\cal {\cal X}}-m^2-p^2)s_\ell}
\label{for-v1}
\end{eqnarray}
\end{small}

The first and second terms in (\ref{for-v1}) agree with Eqn. 2.92 and (first term) Eqn. 2.95  of \cite{Rodf-Diss}, respectively. Knowing that

\begin{small}
\begin{eqnarray*}
{\cal D}_{{\tau_\ell}{\mu_\ell}}\!Y_{{\lambda_\ell}{\mu_\ell}}
- \frac{3}{2}{\cal D}_{{\tau_\ell}{\mu_\ell}}\!Y_{{\lambda_\ell}{\mu_\ell}}
&=&- \frac{1}{2}{\cal D}_{{\tau_\ell}{\mu_\ell}}\!Y_{{\lambda_\ell}{\mu_\ell}}
\nonumber\\
{\cal D}_{{\mu_\ell}{\tau_\ell}}\!Y_{{\lambda_\ell}{\mu_\ell}}
+ \frac{3}{2}{\cal D}_{{\mu_\ell}{\tau_\ell}}\!Y_{{\lambda_\ell}{\mu_\ell}}
=
{\cal D}_{{\mu_\ell}{\tau_\ell}}\!Y_{{\lambda_\ell}{\mu_\ell}}
- \frac{3}{2}{\cal D}_{{\mu_\ell}{\tau_\ell}}\!Y_{{\lambda_\ell}{\mu_\ell}}
&=&
+ \frac{1}{2}{\cal D}_{{\mu_\ell}{\tau_\ell}}\!Y_{{\lambda_\ell}{\mu_\ell}}
\end{eqnarray*}
\end{small}

Although the term ${\cal D}_{{\mu_\ell}{\mu_\ell}}\!Y_{{\lambda_\ell}{\tau_\ell}}$ vanishes after performing the $p^2$ momentum integration in the calculation of ${\cal L}^{(1)[4]}_1$, it will not vanish in ${\cal L}^{(1)[8]}_2$, etc. These simplifications would make the $p^2$ term in (\ref{for-v1}) agree with (second term) Eqn 2.95  of \cite{Rodf-Diss}. Again Ref. \cite{Rodf-Diss} disregarded the last term which we choose to display instead, including terms that will become relevant in higher mass-dimensions. Hence, we have the simplified version of (\ref{for-v1})
\begin{eqnarray}
[4]_\ell\!\!\!&=&\!\!\!
\int^\infty_0 d_{s_\ell}
\left\{
+ {s_\ell} {\cal D}^2{\cal X}
%\nonumber\\&&\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,
+ {p}^2 {s_\ell}^2
