\subsection{${\cal L}^{(1)}_1$: $1$st-order Mass-Dimensional Lagrangians}

Using the compact notation (\ref{ellll}),\footnote{This corresponds to changing $\ell$ in the subscript of tensor indices as 1 if the term is contributed by a first order correction, 2 by a second order correction, and so on. In our presentation, left-most factor in $[\,\,][\,\,]\ldots[\,\,]$ denotes the first order corrrection and the right-most the highest order in the degree of corrections considered. The number of  $[\,\,]$ factors denotes the order of corrections. Adding all numbers indicated in each $[\,\,]$ should sum up to the common mass-dimension of the collected terms.} we now explicitly present the prescription described in (\ref{L0L1L2_emptyset}) in terms of the mass-dimensional basis $[\,\ell\,]$ given in (\ref{thr})-(\ref{twl}):

\begin{eqnarray}
{\cal L}^{(1)[4]}_1
    = \frac{\hbar}{2(2\pi)^D}\mbox{Tr}\int dX
    \int d^Dp %\int^\infty_0 ds
    \,\,\, G_{\emptyset_{\mathrm{t}}}[4]
\label{1[4]}
\end{eqnarray}
with $[4]$ given in (\ref{for}).

\begin{eqnarray}
{\cal L}^{(1)[6]}_1
    = \frac{\hbar}{2(2\pi)^D}\mbox{Tr}\int dX
    \int d^Dp %\int^\infty_0 ds
    \,\,\, G_{\emptyset_{\mathrm{t}}}[6]
\label{1[6]}
\end{eqnarray}
with $[6]$ given in (\ref{six}).

\begin{eqnarray}
{\cal L}^{(1)[8]}_1
    = \frac{\hbar}{2(2\pi)^D}\mbox{Tr}\int dX
    \int d^Dp %\int^\infty_0 ds
    \,\,\, G_{\emptyset_{\mathrm{t}}}[8]
\label{1[8]}
\end{eqnarray}
with $[8]$ given in (\ref{eit}).

\begin{eqnarray}
{\cal L}^{(1)[10]}_1
    = \frac{\hbar}{2(2\pi)^D}\mbox{Tr}\int dX
    \int d^Dp %\int^\infty_0 ds
    \,\,\, G_{\emptyset_{\mathrm{t}}}[10]
\label{1[10]}
\end{eqnarray}
with $[10]$ given in (\ref{ten}).

\begin{eqnarray}
{\cal L}^{(1)[12]}_1
    = \frac{\hbar}{2(2\pi)^D}\mbox{Tr}\int dX
