\chapter{One-Loop Lagrangians with Higher-Order Corrections}
%\input{07_chap5}
%\input{07_chap5-0}
Consider the ungauged case when
\begin{eqnarray}
Y\to 0
\end{eqnarray}
in Eqns. (\ref{thr})-(\ref{twl}). Later we will relax this limit but for purposes of illustration, we present the case of pure $X$ and its covariant derivatives of $X$. That is, we illustrate how straightforward our calculation will be in determining the higher-order corrections. Also, we show step by step how the ensuing integrations: $p$ (momentum), $X$ (background potential), and $s$ (proper-time integration) are performed.

\section{Pure $X$ Mass-Dimensional Lagrangians}

\subsection{Pure $X$: Two Mass-Dimensions}

%\vspace{0.3cm}
%\begin{large}
%\textbf{Two Mass-Dimensions}
%\end{large}
%\vspace{0.3cm}

\begin{eqnarray}
 {\cal L}^{(1)[2]}_{Y\to 0}
 = {\cal L}^{(1)[2]}_{0\,\,Y\to 0} + {\cal L}^{(1)[2]}_{1\,\,Y\to 0}+\ldots
\end{eqnarray}
where ${\cal L}^{(1)[2]}_{k\,\,Y\to 0}$ for $k>0$ does not exist. For the case when $k=0$
from (\ref{0[2]}), it is
\begin{eqnarray}%\label{0[2]}
 {\cal L}^{(1)[2]}_{0\,Y\to 0}
  \!\!&=&\!\! \frac{\hbar}{2(4\pi)^{D/2}}
\int^\infty_0 \frac{ds\,e^{-m^2s}}{s^{-0+D/2}}
   \mbox{Tr}
\left(
   {\cal {\cal X}}-{\cal {\cal X}}_0
\right)
\end{eqnarray}

