\textbf{$[4]{\cal X}$: Six Mass-Dimensions}.


The contributions of $[4]$ to higher mass-dimensions as one moves to higher order terms in the expansion
\begin{eqnarray}
 \left[1+\underbrace{{\cal X}(s_1+s_0)}_{\Uparrow}+\frac{1}{2}(s_1+s_0)^2+\ldots\right]
\label{eX2nd}
\end{eqnarray}
(the second term indicated by an arrow)
\begin{eqnarray}
{\cal L}^{(1)[6]}_{1\,\,\,[4]{\cal X}\,\,\,Y\to 0}
 \!\!&=&\!\!\pi^{D/2}\,\,
  \int^\infty_0\!\!\!ds_1
  \int^\infty_0\!\!\!ds_0
\nonumber\\&&
\left\{
  (2,0\mathrm{;}\,1,0)
 -2(3,0\mathrm{;}\,2,1)
\right\}{\cal X}D_{\mu\mu}{\cal X}
\label{L1[4]X}
\end{eqnarray}
Because the proper-time integrations
\begin{footnotesize}
\begin{eqnarray}
(1,0;1,0)
\!\!\!\!&\equiv &\!\!\!\!
 \int^\infty_0\!\!\!ds_1\!\!
 \int^\infty_0\!\!\! ds_0\,
  \frac{s_0 e^{-m^2(s_0+s_1)}}{1(s_0+s_1)^{0+D/2}}
 =\frac{1}{2}\int^\infty_0\!\!\!ds\frac{e^{-m^2s}}{s^{-2+D/2}}
 =\frac{1}{2}\frac{\Gamma[3-D/2]}{m^{6-D/2}}
\\
(2,0;2,1)
\!\!\!\!&\equiv &\!\!\!\!
 \int^\infty_0\!\!\!ds_1\!\!
 \int^\infty_0\!\!\!ds_0\,
  \frac{{s_0}^2 e^{-m^2(s_0+s_1)}}{2(s_0+s_1)^{1+D/2}}
 =\frac{1}{2}\!\cdot\!\frac{1}{3}\int^\infty_0\!\!\!ds\frac{e^{-m^2s}}{s^{-2+D/2}}
 =\frac{1}{6}\frac{\Gamma[3-D/2]}{m^{6-D/2}}
\end{eqnarray}
\end{footnotesize}
yeild the same prefactor as $(1,0;1,1)$ and (2,0;2,2), respectively, the first-order correction of mass-dimensions six contributed by $[4]{\cal X}$ is given by the Lagrangian
\begin{eqnarray}
{\cal L}^{(1)[6]}_{1\, Y\to 0}
  \!\!&=&\!\frac{\hbar}{2(4\pi)^{D/2}}
\int^\infty_0 \frac{e^{-m^2s}ds}{s^{-2+D/2}}\,\,\,
   \frac{1}{6}  \mathrm{Tr}{\cal X}D_{{\mu}{\mu}}{\cal X}.
\label{1[4]X}
\end{eqnarray}


\textbf{$[4]{\cal X}^2$: Eight Mass-Dimensions}.
With four and six mass-dimensions invariants agreeing with the results obtained by Rodulfo, this work showcases the calculation for the eight mass-dimensions.
Consider the contribution of $[4]$ to higher mass-dimensions as one moves to higher order terms in the expansion
\begin{eqnarray}
 \left[1+{\cal X}(s_1+s_0)+\underbrace{\frac{1}{2}{\cal X}^2(s_1+s_0)^2}_{\Uparrow}+\frac{1}{6}(s_1+s_0)^3+\ldots\right]
\label{eX3rd}
\end{eqnarray}
(the third term indicated by an arrow)


In similar manner, the first order correction of mass-dimensions eight contributed by $[4]{\cal X}^2$ is given by the Lagrangian
\begin{eqnarray}
{\cal L}^{(1)[8]}_{1\,\,\,[4]{\cal X}^2\,\,\,Y\to 0}
  \!\!&=&\!\frac{\hbar}{2(4\pi)^{D/2}}
\int^\infty_0 \frac{e^{-m^2s}ds}{s^{-3+D/2}}\,\,\,
   \frac{1}{12}  \mathrm{Tr}{\cal X}^2D_{{\mu}{\mu}}{\cal X}
\label{1XX[4]}
\end{eqnarray}

Contributions to higher mass-dimensions can be obtained in a similar fashion
\begin{eqnarray}
{\cal L}^{(1)[10]}_{1\,\,\,[4]{\cal X}^3\,\,\,Y\to 0}
  \!\!&=&\!\frac{\hbar}{2(4\pi)^{D/2}}
\int^\infty_0 \frac{e^{-m^2s}ds}{s^{-4+D/2}}\,\,\,
   \frac{1}{36}  \mathrm{Tr}{\cal X}^3D_{{\mu}{\mu}}{\cal X}
\end{eqnarray}
\begin{eqnarray}
{\cal L}^{(1)[12]}_{1\,\,\,[4]{\cal X}^4\,\,\,Y\to 0}
  \!\!&=&\!\frac{\hbar}{2(4\pi)^{D/2}}
\int^\infty_0 \frac{e^{-m^2s}ds}{s^{-5+D/2}}\,\,\,
   \frac{1}{144}  \mathrm{Tr}{\cal X}^4D_{{\mu}{\mu}}{\cal X}
\end{eqnarray}
\begin{eqnarray}
{\cal L}^{(1)[14]}_{1\,\,\,[4]{\cal X}^5\,\,\,Y\to 0}
  \!\!&=&\!\frac{\hbar}{2(4\pi)^{D/2}}
\int^\infty_0 \frac{e^{-m^2s}ds}{s^{-6+D/2}}\,\,\,
   \frac{1}{720}  \mathrm{Tr}{\cal X}^5D_{{\mu}{\mu}}{\cal X}
\end{eqnarray}
\begin{eqnarray}
{\cal L}^{(1)[16]}_{1\,\,\,[4]{\cal X}^6\,\,\,Y\to 0}
  \!\!&=&\!\frac{\hbar}{2(4\pi)^{D/2}}
\int^\infty_0 \frac{e^{-m^2s}ds}{s^{-7+D/2}}\,\,\,
   \frac{1}{4320}  \mathrm{Tr}{\cal X}^6D_{{\mu}{\mu}}{\cal X}
\end{eqnarray}
with the prefactors and exponents of ${\cal X}$ dictated by the coefficients and exponents of a Taylor series of an exponential function.

