\chapter{Summary and Future Work}
%\input{08_summary}
In this thesis, we have developed a prescription that can calculate one-loop effective Lagrangians for various mass-dimensions and for different orders of correction. We have worked out the calculation of ${\cal L}^{1[2]}$, ${\cal L}^{1[4]}$, and ${\cal L}^{1[6]}$ completely; ${\cal L}^{1[8]}$ partially; ${\cal L}^{1[10]}$ and ${\cal L}^{1[12]}$ in their unsimplified form. For appropriate mass-dimensions, first- up to fourth-order corrections were incorporated. The results obtained in the present work for ${\cal L}^{1[2]}$, ${\cal L}^{1[4]}$, and ${\cal L}^{1[6]}$ have been compared to those found in literature and were found to be in complete agreement. ${\cal L}^{1[8]}$ remains to be simplified further and reduced to a 17-term expression before comparison can be made.

