\section{Closed form expressions.}

Three closed form expressions have been obtained.
\begin{enumerate}
 \item[(i)] partial momentum-space derivatives of $G_0(p)$: first- up to sixth-order
 \item[(ii)] $p^8$ integration formula in both arbitrary and flat metric
 \item[(iii)] two- and three-fold proper-time integration formula
\end{enumerate}

We have calculated the closed form formula for handling $p^8$ integral in both flat and arbitrary space-time metric. See Eqn. (\ref{pdeight}) and Appendix C.6, respectively.

We have also developed a more general way of handling two- and three-fold proper-time integrals for various form of integrand. Refer to Chapter 5 or Appendix D on how these different forms were handled. Furthermore, we have also devised a compact notation
\begin{eqnarray*}
(q_0,q_1,\ldots,q_{n-1}\mbox{;}A,B)
 \equiv
\prod^n_{\ell=0}
   \int^\infty_0 ds_\ell
   \frac{{s_0}^{q_0}\ldots {s_{n-1}}^{q_{n-1}}}{A\left(\sum^n_{r=0} s_r\right)^{B+D/2}}
\end{eqnarray*}
as introduced in (\ref{psupp}). The use of such notation are illustrated in detail in Chapter 5.

Knowing the Gaussian sector, we have expressed the non-Gaussian sector of the Green function equation by letting the sixth-order operator act on the Gaussian sector. In so doing, the general closed forms of the partial momentum-space derivatives of $G_0(p)$ have been obtained in terms of $P(s)$, $Q(s)$, and $R(s)$. See Appendix A.

\section{Algorithm}
The following summarizes the procedural programming (advantages) used in this thesis, further proving the possibility of completely automating DeWitt's background field formalism.

\begin{large}
\textbf{Collect then Matrix Multiply}
\end{large}

There are two avenues to choose from when handling (\ref{L1G})
\begin{eqnarray*}
{\cal L}^{(1)}
    &=&\frac{\hbar}{2(2\pi)^D}
    \mbox{Tr}
    \int dX\int d^Dp\,\,\,G_0(p)\sum^{\infty}_{\ell=0}
    \left(\Delta_1(p) G_0\right)^\ell
\end{eqnarray*}
particularly the $\left(\Delta_1(p) G_0\right)^\ell$ term:
\begin{enumerate}
\item[1.)] Multiply the polynomial $\Delta_1(p) G_0$ by itself $\ell=1$, up to $\ell=4$ times consecutively. Then collect terms of similar mass-dimensions. Refer to (\ref{task1})-(\ref{task2}).
\item[2.)] Collect terms of similar mass-dimensions in $\Delta_1(p) G_0$ into basis then matrix multiply them to form the much needed products (the gauge invariant monomials) for a mass-dimension of interest.
\end{enumerate}

