\chapter{Maxima Code of Partial Derivatives of $G_0(p)$}

\section{System of Index Replacements
}
In this chapter, we temporarily make the following replacements in the indices to facilitate us in implementing our algorithm with a Maxima\footnote{This is formerly called Macsyma.} symbolic software.
\[
\{{\mu}_{\ell},{\nu}_{\ell},{\rho}_{\ell},{\sigma}_{\ell},{\alpha}_{\ell},{\beta}_{\ell}\}\to\{{\mathtt{az}},{\mathtt{bz}},{\mathtt{cz}},{\mathtt{dz}},{\mathtt{ez}},{\mathtt{fz}}\}
\]

\[
\{{\lambda}_{\ell},{\tau}_{\ell},{\kappa}_{\ell},{\eta}_{\ell},{\xi}_{\ell},{\varrho}_{\ell}\}\to\{{\mathtt{lz}},{\mathtt{tz}},{\mathtt{kz}},{\mathtt{hz}},{\mathtt{xz}},{\mathtt{gz}}\}
\]

and
\[
 s_\ell \to sz.
\]

%\section{$G_0(p)$}
In the following illustration, we depict how the ensuing integrations (with respect to the matrix potential $X$ and momentum $p$ integrations found in (\ref{L1G}) and proper-time $s$ integration found in (\ref{LG}) will be compressed as we formulate instructions for Maxima to be implemented in a Linux enviroment.

We identify the following partial momentum-space differentiations expressed in Maxima environment:
\begin{eqnarray}
    \mathrm{Ga}
    &\equiv &\frac{\partial G_0(p)}{\partial p_{\mu}}
    =\int^\infty_0\,\,ds
    (-R_{{\mu}{\lambda}}p_{\lambda})e^{-\Theta}
    \nonumber\\ \label{gga}
    &\equiv & \mathrm{-Q\_a-R\_al*p\_l;}
\end{eqnarray}
where
\begin{eqnarray}
 \Theta=-Xs+\frac{1}{2}\mbox{tr}Y^2s^2-\frac{1}{2}p\cdot \left(-2s+\frac{2}{3}Y^2s^3\right)\cdot p
\end{eqnarray}
\begin{eqnarray}
    \mathrm{Gb}
    &\equiv &\frac{\partial G_0(p)}{\partial p_{\nu}}
    =\int^\infty_0\,\,ds
    (-R_{{\nu}{\tau}}p_{\tau})e^{-\Theta}
    \nonumber\\
    &\equiv & \mathrm{-R\_bt*p\_t;}.
\end{eqnarray}

Differentiating (\ref{gga}) with respect to $p_{\nu}$
\begin{eqnarray}
    \mathrm{Gab}
    \!\!\!\!\!&\equiv &\!\!\!\!\!\frac{\partial^2 G_0(p)}{\partial p_{\mu}\partial p_{\nu}}
    =\int^\infty_0\,\,ds
    (-R_{{\mu}{\nu}}
        +R_{{\mu}{\tau}}R_{{\nu}{\lambda}}p_{\tau}p_{\lambda})e^{-\Theta}
    \nonumber\\ \label{Ga}
    \!\!\!\!\!&\equiv & \!\!\!\!\!
    \mathrm{- R\_ab
        + p\_l* p\_t* R\_al* R\_bt;}%\nonumber\\
\end{eqnarray}

For convenience, $\mathrm{p\_l* p\_t}$  were compressed further into $\mathrm{p* p}$. Its indices were easily rebooked by looking at the subindices ($\mathrm{l}$ and $\mathrm{l}$) of $\mathrm{R\_al* R\_bt}$.


