\chapter{$N$-fold Proper Time Integrations}
In the calculation of the one-loop effective Lagrangian prescribed by\footnote{Here,
\begin{eqnarray}
    G_0
        =\!\!\int_0^\infty\!\!\!ds\,\,
     e^{-\Theta(s)}
        =\!\!\int_0^\infty\!\!\!ds\,\,
     e^{-(m^2+X)s-P(s)-Q(s)\cdot p-\frac{1}{2}p\cdot R(s)\cdot p}
\end{eqnarray}
is expressed in terms of exact trancedental functions $P(s)$, $Q(s)$, and $R(s)$.}

\begin{eqnarray}
    {\cal L}^{(1)}=\sum^\infty_{\ell=0}{\cal L}^{(1)}_\ell
    =\frac{\hbar}{2(2\pi)^D}
    \mbox{Tr}
    \int dX\int d^Dp \,G_0\sum^{\infty}_{\ell=0}
    \left(\Delta_1 G_0\right)^\ell,
\end{eqnarray}
up to $\ell$-th order corrections, there is an ensuing $X$ integration, $p$ integration\footnote{See Appendix C on how to handle momentum integrations in $D$-dimensions.}, and $\ell$-th fold proper-time integrations:
\begin{eqnarray}\label{1pt}
    {\cal L}^{(1)}_0
    =\frac{\hbar}{2(2\pi)^D}
    \mbox{Tr}\!\!
    \int\!\!\!dX\!\!\int\!\!\!d^Dp
    \!\!\int_0^\infty\!\!\!ds_1\,\,
         f\left(s_1\right)
\end{eqnarray}
\begin{eqnarray}\label{2pt}
    {\cal L}^{(1)}_1
    =\frac{\hbar}{2(2\pi)^D}
    \mbox{Tr}\!\!
    \int\!\!\!dX\!\!\int\!\!\!d^Dp
    \!\!\int_0^\infty\!\!\!ds_2\,\,
       \!\!\int_0^\infty\!\!\!ds_1\,\, f\left(s_1,s_2\right)
\end{eqnarray}
\begin{eqnarray}\label{3pt}
    {\cal L}^{(1)}_2
    =\frac{\hbar}{2(2\pi)^D}
    \mbox{Tr}\!\!
    \int\!\!\!dX\!\!\int\!\!\!d^Dp
    \!\!\int_0^\infty\!\!\!ds_3\,\,
      \!\!\int_0^\infty\!\!\!ds_2\,\,
      \!\!\int_0^\infty\!\!\!ds_1\,\,f\left(s_1,s_2,s_3\right)
\end{eqnarray}
for $\ell=1$ to $\ell=3$, respectively.

In this chapter, we present a method of handling two-fold\footnote{The one-fold proper time integration (\ref{1pt}) is handled by an ordinary technique in integral calculus, which we choose to exclude in our presentation here.} (\ref{2pt}) up to three-fold (\ref{3pt}) proper-time integrations which this thesis extensively used.

For purposes of emphasis, we choose to isolate the ensuing proper-time integration. We opt to express the $(\ell+1)$st-fold proper-time integration in the following suppressed notation:
\begin{eqnarray}
f(s_{q_0},\ldots,s_{q_\ell})&\equiv &(q_0,q_1,\ldots,q_{\ell}\,\mathrm{;}\,{\cal A},{\cal B})
\nonumber\\
 &\equiv & \frac{1}{\ell+1}
\prod^\ell_{k=0}
   \int^\infty_0 ds_k
   \frac{\prod^{\ell}_{r=0} {s_{r}}^{q_{r}}}{{\cal A}\left(\sum^{\ell}_{r=0} s_r\right)^{{\cal B}+D/2}}\,e^{-m^2\left(\sum^{\ell}_{r=0}{s_{r}}\right)}
\label{psupp}
\end{eqnarray}
with $\ell+1$ is the number of proper-time variables $s_0,\ldots,s_{\ell}$ and also the number of folds of integration. The $q$'s stand for the powers of the proper-time variables. A semicolon separates these powers of proper-time variables from the resulting $X$-integration number $A$ in the denominator and power $B$ of $(\sum^n_{r=0} s_r)$. With this notation, the proper-time integration will not be written explicitly from then on.

In our technique of integration, we will be using repeatedly for every fold the Euler integral representation of the Gamma function
\begin{equation}\label{GAMMA}
  \Gamma(z+1)
   =\int^\infty_0\,\,dx\,\,e^{-x}x^z.
\end{equation}


Note: To remove the ambiguity of the variable $D$ either as a variable of integration or as dimensions of integration space, we denote (in this chapter only) the latter meaning as $D'$. Otherwise in the rest of the chapters, $D$ denotes dimensions.

\section{Two-fold Proper Time Integration}
The two-fold proper time integral of the form
\begin{equation}
  \int^\infty_0\,\,ds_1
    \int^\infty_0\,\,ds_0\,\,
    f(s_0,s_1)e^{-m^2(s_0+s_1)}
\end{equation}
can be evaluated through the simultaneous substitution
\begin{equation}
\begin{array}{l}
    B=s_1+s_0 \\
    A=-s_1+s_0.
  \end{array}
\end{equation}
Eliminating $s_0$ and $s_1$ in favor of $A$ and $B$ through
\begin{equation}
\begin{array}{l}
    s_1=(1/2)(B-A) \\
    s_0=(1/2)(B+A).
  \end{array}
\end{equation}
Its Jacobian is given by
\begin{equation}
  \frac{\partial (s_0,s_1)}{\partial (A,B)}
    =\frac{1}{2}.
\end{equation}
Changing variables entails a change in the limits of integration. These are
\begin{equation}
\begin{array}{c}
    -B \leq A \leq B\\
    0 \leq B < \infty.
  \end{array}
\end{equation}
Thus\footnote{The limits of the variable of integration $A$ are obtained simply by setting $s_1=0$ for the upper limit and $s_0=0$ for the lower limit. The limits of last variable of integration (for this case $B$) are $\infty$ and $0$ for upper and lower limit, respectively.},
\begin{eqnarray}
%  &&
  \int^\infty_0\,\,ds_1
    \int^\infty_0\,\,ds_0\,\,
    f(s_0,s_1)e^{-m^2(s_0+s_1)}
% \nonumber\\
%  &=&
=
   \frac{1}{2}
   \int^\infty_0\!\!dB
     \int^{B}_{-B}\!\!dA\,\,
   f(A,B)e^{-m^2B}\label{2ptime}
\end{eqnarray}

The following are some of the two-fold proper-time integrations used in this thesis:
%\begin{footnotesize}
\begin{eqnarray}
\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!
(1,0;1,1)
\!\!\!\!&\equiv &\!\!\!\!
 \int^\infty_0\!\!\!ds_1\!\!
 \int^\infty_0\!\!\! ds_0\,
  \frac{s_0 e^{-m^2(s_0+s_1)}}{1(s_0+s_1)^{1+D/2}}
 \!=\!\frac{1}{2}\!\int^\infty_0\!\!\!ds\frac{e^{-m^2s}}{s^{-1+D/2}}
 \!=\!\frac{1}{2}\frac{\Gamma[2-D/2]}{m^{4-D/2}}
\end{eqnarray}
\begin{eqnarray}
\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!
(2,0;2,2)
\!\!\!\!&\equiv &\!\!\!\!
 \int^\infty_0\!\!\!ds_1\!\!
 \int^\infty_0\!\!\!ds_0\,
  \frac{{s_0}^2 e^{-m^2(s_0+s_1)}}{2(s_0+s_1)^{2+D/2}}
  \!=\!\frac{1}{2}\!\cdot\!\frac{1}{3}\!\int^\infty_0\!\!\!ds\frac{e^{-m^2s}}{s^{-1+D/2}}
 \!=\!\frac{1}{6}\frac{\Gamma[2-D/2]}{m^{4-D/2}}
\end{eqnarray}
\begin{eqnarray}
\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!\!
(3,0;4,3)
\!\!\!\!&\equiv &\!\!\!\!
 \int^\infty_0\!\!\!ds_1\!\!
 \int^\infty_0\!\!\!ds_0\,
  \frac{{s_0}^3 e^{-m^2(s_0+s_1)}}{4(s_0+s_1)^{3+D/2}}
 \!=\!\frac{1}{2}\!\cdot\!\frac{1}{8}\!\int^\infty_0\!\!\!ds\frac{e^{-m^2s}}{s^{-1+D/2}}
 \!=\!\frac{1}{16}\!\frac{\Gamma[2-D/2]}{m^{4-D/2}}
\end{eqnarray}
%\end{footnotesize}
where
\begin{equation}\label{2fss}
  f(s_0,s_1)
   =\frac{{s_0}^p}{2^{p-1}(s_0+s_1)^{p+D'/2}}\,\,\,\,\,\,\,\mbox{for}\,\,p=1,2,3
\end{equation}
respectively.
In all cases,
\begin{eqnarray}
\int^\infty_0\!\!\!ds\frac{e^{-m^2s}}{s^{-1+D/2}}
 =\frac{\Gamma[2-D/2]}{m^{4-D/2}}.
\end{eqnarray}
This uses the Euler integral representation of the Gamma function (\ref{GAMMA}).

