\section{Three-fold Proper Time Integration}
The three-fold proper time integral of the form
\begin{equation}
  \int^\infty_0\,\,ds_2
  \int^\infty_0\,\,ds_1
    \int^\infty_0\,\,ds_0\,\,
    f(s_0,s_1,s_2)e^{-m^2(s_0+s_1+s_2)}
\end{equation}
can be evaluated through the simultaneous substitution
\begin{equation}
\begin{array}{l}
    C=s_2+s_1+s_0 \\
    B=-s_2+(1/2)(s_1+s_0) \\
    A=-s_1+s_0.
  \end{array}
\end{equation}
Eliminating $s_0$, $s_1$ and $s_2$ in favor of $A$, $B$ and $C$ through
\begin{equation}
\begin{array}{l}
    s_2=(1/3)(C-2B)\\
    s_1=(1/3)(C+B)-(1/2)A \\
    s_0=(1/3)(C+B)+(1/2)A.
  \end{array}
\end{equation}
Its Jacobian is given by
\begin{equation}
  \frac{\partial (s_0,s_1,s_2)}{\partial (A,B,C)}
    =\frac{1}{3}.
\end{equation}
Changing variables entails a change in the limits of integration. These are
\begin{equation}
\begin{array}{c}
    -\frac{2}{3}(C+B) \leq A \leq \frac{2}{3}(C+B)\\
    -C \leq B \leq C/2\\
    0 \leq C < \infty.
  \end{array}
\end{equation}
Thus\footnote{The limits of the variable of integration $A$ are obtained simply by setting $s_1=0$ for the upper limit and $s_0=0$ for the lower limit. For the variable of integration $B$, these are obtained by setting $s_2=0$ and $s_0+s_1=0$, respectively for upper and lower limit of $\int\,dB$. The limits of last variable of integration (for this case $C$) are $\infty$ and $0$ for upper and lower limit, respectively.},
\begin{eqnarray}
  &&
  \int^\infty_0\,\,ds_2
  \int^\infty_0\,\,ds_1
    \int^\infty_0\,\,ds_0\,\,
    f(s_0,s_1,s_2)e^{-m^2(s_0+s_1+s_2)}
 \nonumber\\
  &=&
   \frac{1}{3}
   \int^\infty_0\!\!dC
   \int^{C/2}_{-C}\!\!dB
     \int^{\frac{2}{3}(C+B)}_{\frac{2}{3}(-C-B)}\!\!dA\,\,
   f(A,B,C)e^{-m^2C}\label{3ptime}
\end{eqnarray}

The following are some of the three-fold proper-time integration used in this thesis:
\begin{scriptsize}
\begin{eqnarray}
(1,1,0;2,2)
\!\!\!\!&\equiv &\!\!\!\!
 \int^\infty_0\!\!\!\!\!\!\!ds_2\!\!
 \int^\infty_0\!\!\!\!\!\!\!ds_1\!\!
 \int^\infty_0\!\!\!\!\!\!\! ds_0\,
  \frac{{s_0}{s_1} e^{-m^2(s_0+s_1+s_2)}}{2(s_0+s_1+s_2)^{2+D/2}}
 \!=\!\frac{1}{3}\cdot\frac{1}{16}\!\int^\infty_0\!\!\!ds\frac{e^{-m^2s}}{s^{-2+D/2}}
 \!=\!\frac{1}{48}\frac{\Gamma[3-D/2]}{m^{6-D/2}}
\\
(2,1,0;4,3)
\!\!\!\!&\equiv &\!\!\!\!
 \int^\infty_0\!\!\!\!\!\!\!ds_2\!\!
 \int^\infty_0\!\!\!\!\!\!\!ds_1\!\!
 \int^\infty_0\!\!\!\!\!\!\!ds_0\,
  \frac{{s_0}^2{s_1} e^{-m^2(s_0+s_1+s_2)}}{4(s_0+s_1+s_2)^{3+D/2}}
 \!=\!\frac{1}{3}\cdot\frac{1}{80}\!\int^\infty_0\!\!\!ds\frac{e^{-m^2s}}{s^{-2+D/2}}
 \!=\!\frac{1}{240}\frac{\Gamma[3-D/2]}{m^{6-D/2}}
\\
(1,2,0;4,3)
\!\!\!\!&\equiv &\!\!\!\!
 \int^\infty_0\!\!\!\!\!\!\!ds_2\!\!
 \int^\infty_0\!\!\!\!\!\!\!ds_1\!\!
 \int^\infty_0\!\!\!\!\!\!\!ds_0\,
  \frac{{s_0}{s_1}^2 e^{-m^2(s_0+s_1+s_2)}}{4(s_0+s_1+s_2)^{3+D/2}}
 \!=\!\frac{1}{3}\cdot\frac{1}{80}\!\int^\infty_0\!\!\!ds\frac{e^{-m^2s}}{s^{-2+D/2}}
 \!=\!\frac{1}{240}\frac{\Gamma[3-D/2]}{m^{6-D/2}}
\\
(2,2,0;8,4)
\!\!\!\!&\equiv &\!\!\!\!
 \int^\infty_0\!\!\!\!\!\!\!ds_2\!\!
 \int^\infty_0\!\!\!\!\!\!\!ds_1\!\!
 \int^\infty_0\!\!\!\!\!\!\!ds_0\,\!
  \frac{{s_0}^2{s_1}^2 e^{-m^2(s_0+s_1+s_2)}}{8(s_0+s_1+s_2)^{4+D/2}}
 \!=\!\frac{1}{3}\cdot\frac{1}{480}\!\int^\infty_0\!\!\!\!ds\frac{e^{-m^2s}}{s^{-2+D/2}}
 \!=\!\frac{1}{1440}\frac{\Gamma[3-D/2]}{m^{6-D/2}}
\end{eqnarray}
\end{scriptsize}
where
\begin{eqnarray}
  f(s_0,s_1,s_2)=
  \frac{{s_0}^p{s_1}^q e^{-m^2(s_0+s_1+s_2)}}{2^{(p+q)-1}(s_0+s_1+s_2)^{4+D/2}}
  \,\,\,\,\,\,\,\mbox{for}\,\,p+q=2,3,4
\end{eqnarray}
In all cases,
\begin{eqnarray}
 \int^\infty_0\!\!\!ds\frac{e^{-m^2s}}{s^{-2+D/2}}
 =\frac{\Gamma[3-D/2]}{m^{6-D/2}}
\end{eqnarray}
respectively.

This again uses the Euler integral representation of the Gamma function (\ref{GAMMA}).

