\section{Proper-time Integral and Gamma Function Equivalence}

\begin{eqnarray}
\int^\infty_0\!\!\!ds\frac{e^{-m^2s}}{s^{-k+D/2}}
 \equiv\frac{\Gamma[(k+1)-D/2]}{m^{2(k+1)-D/2}}.
\end{eqnarray}
with $k=0,1,2,3,4,5,6,7$.

